import React from 'react';
import './tshirts.css';
import shirt1 from './images/cloths.avif'

const Tshirts = () => {
  return (
    <section id='tshirtsection'>
        <h1 id='tshirtsectionh1'>"Elevate Your Style: Discover Men's Fashion Essentials"</h1>
        <div id='outer'>
            <div id='shirt1'> <img src={shirt1}/>
            <h1>One time deal</h1>
                   <h1>Price: 899 RS</h1>
                   </div>
        </div>


    </section>
  )
}

export default Tshirts
